sys_variable_value.value:
(function execute(inputs, outputs) {
 var StartTime = inputs.StartTime; 
 var newStartTime = StartTime.replace(/ /, 'T'); 

 var EndTime = inputs.EndTime; 
 var newEndTime = EndTime.replace(/ /, 'T'); 


  outputs.newstarttime = newStartTime +".0";
  outputs.newendtime = newEndTime + ".0";







})(inputs, outputs);

